import React from 'react'

const mainStyle = {
  maxWidth: "100%",
  border: "5px soild red",
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  flexWrap: "wrap",
  
};

const mainIndividualDiv = {
  height: "150px",
  width: "16rem",
  border: "1px soild red",
  backgroundColor: "green" 
}

export default function Main() {
  return (
    <div style={mainStyle}>
      <div style= {mainIndividualDiv}></div>
      <div style= {mainIndividualDiv}></div>
      <div style= {mainIndividualDiv}></div>
      <div style= {mainIndividualDiv}></div>
      <div style= {mainIndividualDiv}></div>
      <div style= {mainIndividualDiv}></div>
      <div></div>
    </div>
  );
}
